import React, { useEffect, useState } from 'react';
import {ITask} from "./components/interface/interface";
import httpQuery from "../src/components/httpQuery/httpQuery";
import TasksContainer from "./components/tasks-container/tasks-container";

const App = () => {

  const [task, setTask] = useState<ITask[]>([])

  console.log('123', task);

  useEffect(() => {
     getAllTasks()
  }, [])

  async function getAllTasks(): Promise<ITask[] | void>  {
    try {
      const response = await httpQuery.get('/allTasks')
      setTask(response.data.data)
    } catch (e) {
      console.log('I`M Error on GET query!', e)
    }
  }
  return (
    <div>
      <TasksContainer tasks={task}/>
    </div>

  );
}
export default App;
